import Home from "./pages/Home";
import About from "./pages/About";
import Login from "./pages/Login";
import {Routes, RouteObject, Link} from "react-router-dom";


function App() {
  return (
    <div>
      <nav>
      <Link to="/">Home</Link>
      <Link to="/about">About</Link>
      </nav>
      <Home/>
    </div>
  );
}

export default App;
